import './App.css';

function App() {
  let my="harry";
  return (
    <>
    <nav>
      <li>home</li>
      <li>about</li>
      <li>more</li>
    </nav>
    <div className="container">
      <h1>hallo {my}</h1>
    </div>

    </>
  );
}

export default App;
